export async function getMessages() {
  try {
    const res = await fetch("http://www.mocky.io/v2/5ae1c5792d00004d009d7e5c");
    const data = await res.json();
    return data;
  } catch (error) {
    alert(
      "An error has occured while getting the data, please try again later."
    );
    return [];
  }
}
